import { usePost } from "../context/postContext"

export const HomePage = () => {

  const {setPost} = usePost()



  return (
    <div>HomePage
    
    <Link className="bg-white" to="/new">
      go to new
    </Link>

    <button onClick={() => setPost([1,2,4])}>
      add
    </button>

    </div>
  )
}
